import "./App.css";
import registro from "./images/registro-juridica-sin-lucro-ok.png";
import logo from "./images/logo-registro-civil-300-jpg copy.jpg";
import compromisos from "./images/compromisos-de-gestion-institu-ok.png";
import gobierno from "./images/gobierno-transparente-sole-ok.png";
import codigo from "./images/codigo-de-etica-ok.png";
improt
function App() {
  return (
    <div className="App">
      <div className="background-header">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
        </header>
      </div>

      <div className="background-grey1">
        <div className="box1-grey">
          <img src={registro} alt="" />
          <img src={compromisos} />
          <img src={gobierno} />
        </div>
        <div className="box1-grey">
          <img src={codigo} alt="" />
          <img src={compromisos} />
          <img src={compromisos} />
        </div>
      </div>
    </div>
  );
}

export default App;
